import {useNavigate} from 'react-router-dom';
import VideoComp from './videoComp';
import React from 'react';

export const Page1 = () => {
    const navigate = useNavigate();
    const fun2 = () => {
        setTimeout(() => {
            console.log('２個目の関数');
        }, 100);
        const fun3 = () => {
            setTimeout(() => {
                console.log('3個めの関数');
            }, 100);
        };
        console.log(fun3());
    };
    const func1 = (fun2:  void) => {
        console.log(fun2);
    };
    const test = () => {
        setTimeout(() => {
            console.log(func1(fun2()));
        }, 100);
    };
    const nextStage = (): void => {
        navigate('/page2');
    };
    const soundPlay = ()=>{
        const ani1 = $('.ani1').get(0)
    }
    return (
        <div>
            <h1>ようこそ、もとしの部屋へ</h1>
            <button onClick={nextStage}>次なるステージへ</button>
            <button onClick={test}></button>
            <VideoComp/>
        </div>
    );
};
